import React from "react";
import { TodoMainTitle } from './components/TodoMainTitle';

const style = {
  parent: {
    display: "flex",
    flex: 1,
    justifyContent: "center",
    alignItems: "center"
  },
  container: {
    width: "30%",
    height: "70vh",
    backgroundColor: "#e6e6e6",
    borderRadius: 10
  }
};

export const TodoContainer = () => {
  return (
    <div style={style.container}>
      <TodoMainTitle/>
    </div>
  );
};

export default TodoContainer;
